<script>
        function center_marker(path_n)
        {

        	  //var svg   = document.querySelector("svg");
        	   var svg = document.getElementById ("anatomy");
        	  //document.createElementNS (xmlns, "svg");
          var svgns = "http://www.w3.org/2000/svg";

          // get the center
          //var el = document.querySelector("#"+ path_n);
          var el = document.querySelector("#"+ path_n);
          var bbox = el.getBoundingClientRect();
          var center = {
             x: (bbox.left + bbox.width)/2,
             y: (bbox.top  + bbox.height)/2
          };

          // create the dot
          var dot = document.createElementNS(svgns, "circle");
          console.log(dot);
          dot.setAttribute("cx", center.x);
          dot.setAttribute("cy", center.y);
          dot.setAttribute("r", 100);
          svg.appendChild(dot);
        }
$(document).ready(function(){
var svg = document.getElementsByTagName('svg')[0]; //Get svg element
var newElement = document.createElementNS("http://www.w3.org/2000/svg", 'path'); //Create a path in SVG's namespace
newElement.setAttribute("d","M 0 0 L 10 10"); //Set path's data
newElement.style.stroke = "#000"; //Set stroke colour
newElement.style.strokeWidth = "5px"; //Set stroke width
svg.appendChild(newElement);

    $("#anatomy").mouseenter(function(){
      $(this).children().css({ "stroke": "#e8e8e8"});
      $(this).children();

var clicked=0;

console.log('here: ');
 var $out = $("div.out");
 // alert("assigned div");
$("#anatomy").on("mouseenter", "path", function(e){
    var $target = $(e.currentTarget);
        $out.html($target.attr("id"));
        console.log('mousenter: ' + $target.attr("id")); 
        // console.log('mousenter: ' + $target.attr("RefX")); 
        if ($target.attr("sel")==0) {
         $target                .css({ "fill": "yellow", "opacity" : "0.3"});
     }
$target.attr("sel",0);
   
});
$("#anatomy").on("mouseleave", "path", function(e){
    var $target = $(e.currentTarget);



if ($target.attr("sel")==0) {
        $target                .css({ "fill": "none", "opacity" : "0.3"});
}

});

$("#anatomy").on("mousedown", "path", function(e){
	var $target = $(e.currentTarget);
console.log('clicked: ' + $target.attr("id"));

center_marker($target.attr("id"));

    if ($target.attr("sel")==0) {
        $target                .css({ "fill": "rgb(0, 0, 0)","opacity" : "0.8"});
        $target.attr("sel",1);
       $target.fadeToggle(3000);
       $target                .css({ "fill": "rgb(0, 0, 0)","opacity" : "0.8"});
    }
    else {$target                .css({ "fill":"rgb(200, 200, 200)", "opacity" : "0.8"});
$target.attr("sel",0);};

</script>
